import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css'; // Ensure this file exists and contains the necessary styles

function HomePage() {
  return (
    <div className="home-container">
      <header className="home-header">
        <img src="logo_ecommerce.png" alt="Logo" className="home-logo" />
        <h1>Welcome to Our Store</h1>
      </header>
      <section className="home-about">
        <h2>About Us</h2>
        <p>This is a brief section about your store...</p>
      </section>
      <footer className="home-footer">
        <Link to="/products" className="button">View Products</Link>
      </footer>
    </div>
  );
}

export default HomePage;
